const ReducerPlayer = () => {
    var player = {
        name: "Praki",
        age: 20,
        awards: ["gold", "silver", "copper"]
    };
    console.log(player.name + " " + player.age + player.awards[0]);

    const addAge = (plyr = {}) => {
        plyr.age = plyr.age + 6;
        return plyr;
    }
    addAge(player);
    console.log("Name " + player.name + "Age " + player.age + " Awards"+player.awards[0]);

}
export default ReducerPlayer
